import React, { Component } from 'react';

const images = [
  "../assets/pink-lollipop.jpeg",
]

class Content extends Component {
  constructor(props) {
    super(props);

    this.state = {
      imageSrc : ""
    }

  }

  componentDidMount() {
    this.setState({
      imageSrc: images[Math.floor(Math.random()*images.length)]
    })
  }



  render () {
    return (
      <img src={this.state.imgSrc}/>
    )
  }
}

export default Content;
